import React, { Component } from 'react';
import './About.css';
import imgSrc from "../images/MichaelCoca.png";
  
export default class About extends Component {
  render() {
    return (
      <div>
        <img className="profile_image split left" src={imgSrc} alt="Michael" />
        <div>
          <h1 className="name_title">Michael Coca-Vargas</h1>
          <p className="split right brief_description"></p>
        </div>
        
      </div>
    )
  }
}
